import React, { useEffect, useState } from "react";
import { LineChart, Line, XAxis, YAxis, Tooltip, CartesianGrid, ResponsiveContainer } from "recharts";
import { useNavigate } from "react-router-dom";

export default function Tracker() {
  const [entries, setEntries] = useState([]);
  const [activity, setActivity] = useState("");
  const [emission, setEmission] = useState("");
  const navigate = useNavigate();

  useEffect(() => {
    fetch("http://localhost:5000/api/entries")
      .then((res) => res.json())
      .then((data) => setEntries(data));
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!activity || !emission) return;
    const res = await fetch("http://localhost:5000/api/entries", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ activity, emission }),
    });
    const newEntry = await res.json();
    setEntries([newEntry, ...entries]);
    setActivity("");
    setEmission("");
  };

  const handleLogout = () => {
    localStorage.removeItem("user");
    navigate("/login");
  };

  // Prepare chart data
  const chartData = entries
    .slice()
    .reverse()
    .map(e => ({
      date: new Date(e.date).toLocaleDateString(),
      emission: Number(e.emission),
    }));

  return (
    <div className="" style={{ maxWidth: 600, margin: "40px auto", padding: 24, border: "1px solid #ddd", borderRadius: 8 }}>
      <div style={{display: "flex", justifyContent: "space-between", alignItems: "center"}}>
        <h1 className="text-2xl font-semibold text-center pl-35">Carbon Footprint Tracker</h1>
        <button onClick={handleLogout} className="border-2 border-blue-800 rounded-xl p-3">Logout</button>
      </div>
      <form onSubmit={handleSubmit} style={{ marginBottom: 24 }}>
        <input
          value={activity}
          onChange={(e) => setActivity(e.target.value)}
          placeholder="Activity"
          style={{ marginRight: 8, padding: 6 }}
        />
        <input
          value={emission}
          onChange={(e) => setEmission(e.target.value)}
          type="number"
          placeholder="Emission (kg CO2e)"
          style={{ marginRight: 8, padding: 6 }}
          min="0"
        />
        <button type="submit" style={{ padding: "6px 14px" }}>Add Entry</button>
      </form>
      <h2>Entries</h2>
      <ul style={{ listStyle: "none", padding: 0 }}>
        {entries.map((entry) => (
          <li key={entry._id} style={{ marginBottom: 10, borderBottom: "1px solid #eee", paddingBottom: 8 }}>
            <strong>{new Date(entry.date).toLocaleDateString()}</strong>: {entry.activity} — {entry.emission} kg CO2e
          </li>
        ))}
        {entries.length === 0 && <li>No entries yet.</li>}
      </ul>
      <h3 style={{marginTop: 40}}>Emissions Over Time</h3>
      <ResponsiveContainer width="100%" height={300}>
        <LineChart data={chartData}>
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="date" />
          <YAxis label={{ value: "kg CO2e", angle: -90, position: "insideLeft" }}/>
          <Tooltip />
          <Line type="monotone" dataKey="emission" stroke="#8884d8" />
        </LineChart>
      </ResponsiveContainer>
    </div>
  );
}
